        <div class="welcome-content desktop">
            <button class="close-welcome"></button>
            <h1>Welcome to City Hive </h1>
            
            <section class="what-is">
                <h2>What is City Hive?</h2>
                <p>City Hive is a community-powered mapping tool that helps track feral honey bee colonieswild hives that live in tree cavities, walls, and other hidden spots across our urban landscape. These aren't the managed hives you might see in a beekeeper's apiary. Feral colonies form on their own, often after a swarm splits off from an existing hive. They represent a critical but largely undocumented part of the urban ecosystem.</p>
                <p>City Hive is designed to make this hidden world visible.</p>
            </section>

            <section class="why-matters">
                <h2>Why This Matters</h2>
                <ul>
                    <li>Feral hives may be more genetically diverse or more adapted to local environments than managed colonies</li>
                    <li>They play a crucial role in pollination, often in places where managed hives aren't present</li>
                    <li>Understanding where and how they survive helps support bee conservation, swarm management, and even public safety</li>
                </ul>
            </section>

            <section class="getting-started">
                <h2>Getting Started</h2>
                <h3>How to Use City Hive</h3>
                <p>Using just a smartphone, anyone can add a sighting to our live maptagging locations of wild hives, active swarms, or structures where bees are living. Each marker supports photos, detailed notes, and collaborative comments, making it easy to share what you see and learn from others. All updates appear in real time, so the tool is equally useful for fieldwork, research, or even casual urban exploration.</p>
            </section>

            <section class="features">
                <h2>Current Features</h2>
                <p>City Hive is already live and in use. You can:</p>
                <ul>
                    <li>View and add sightings</li>
                    <li>Upload photos</li>
                    <li>Track colony activity over time</li>
                    <li>Use our mobile-friendly interface</li>
                    <li>Get instant updates across all users</li>
                    <li>Make detailed observations through our touch-friendly interface</li>
                </ul>
            </section>

            <section class="future">
                <h2>Looking Ahead</h2>
                <p>We're working on:</p>
                <ul>
                    <li>Real-time swarm alerts for emergency response and community coordination</li>
                    <li>Research tools to link colonies with local flora and environmental data</li>
                    <li>Educational outreach and partnerships with schools, parks, and conservation groups</li>
                    <li>Long-term data collection to better understand bee health and urban biodiversity</li>
                </ul>
            </section>

            <section class="community">
                <h2>Join Our Community</h2>
                <p>City Hive is a tool for beekeepersbut also for researchers, naturalists, city planners, and anyone who cares about the health of urban ecosystems. By helping map and monitor wild bees in New York and beyond, we're building a clearer picture of pollinator life in the cityand a stronger foundation for protecting it.</p>
            </section>

            <footer>
                <p><em>City Hive is a community project built with  for the New York Bee Club</em></p>
            </footer>
        </div>
